pragma solidity ^0.5.0;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/ownership/Ownable.sol";
import "./Events.sol";

contract UsersInstance {
    uint256 public usersCount;
    function getRemainingFreeTransactions(address userAddress) public view returns (uint16);
    function getUserAddress(uint256 index) public view returns (address);
    function getTransactionFeeValues(address userAddress) public view returns (uint8[2] memory);
    function isActive(address userAddress) public view returns (bool);
    function isSuperUser(address userAddress) public view returns (bool);
}

contract Digitall is Ownable, Events {
    using SafeMath for uint256;

    uint256[3] purchaseWithCreditCardFeeValues = [29, 1000, 300000]; // => 2.9% fee; (amount * 29 / 1000) + 30 cents.
    uint256[3] purchaseWithCryptoFeeValues = [0, 1, 0]; // => 0% for now.
    uint256[3] purchaseWithEurCreditCardFeeValues = [7, 500, 200000]; // => 1.4% fee; (amount * 29 / 1000) + 20 cents.
    uint256[2] storageFeeValues = [1, 10];  // 10%
    uint256[2] flatFeeValues = [10000000000, 50000000]; // if transaction is for more than 10k add $50 fee on top.
    address UsersContractAddress;

    constructor(address usersAddress)
        public
    {
        UsersContractAddress = usersAddress;
    }

    function setFlatFeeValues(uint256[2] memory newValues)
        public
        onlyOwner
        returns (bool)
    {
        flatFeeValues = newValues;
        return true;
    }

    function setPurchaseWithCreditCardFeeValues(uint256[3] memory newValues)
        public
        onlyOwner
        returns (bool)
    {
        purchaseWithCreditCardFeeValues = newValues;
        return true;
    }

    function setPurchaseWithEurCreditCardFeeValues(uint256[3] memory newValues)
        public
        onlyOwner
        returns (bool)
    {
        purchaseWithEurCreditCardFeeValues = newValues;
        return true;
    }

    function setPurchaseWithCryptoFeeValues(uint256[3] memory newValues)
        public
        onlyOwner
        returns (bool)
    {
        purchaseWithCryptoFeeValues = newValues;
        return true;
    }

    function setStorageFeeValues(uint256[2] memory newValues)
        public
        onlyOwner
        returns (bool)
    {
        storageFeeValues = newValues;
        return true;
    }

    function getFlatFeeValues() public view returns (uint256[2] memory) {
        return flatFeeValues;
    }

    function getPurchaseWithCreditCardFeeValues() public view returns (uint256[3] memory) {
        return purchaseWithCreditCardFeeValues;
    }

    function getPurchaseWithCryptoFeeValues() public view returns (uint256[3] memory) {
        return purchaseWithCryptoFeeValues;
    }

    function getPurchaseWithEurCreditCardFeeValues() public view returns (uint256[3] memory) {
        return purchaseWithEurCreditCardFeeValues;
    }

    function getStorageFeeValues() public view returns (uint256[2] memory) {
        return storageFeeValues;
    }

    function determineFeeSplit(uint256 fee, address fromReferrerAddress, address toReferrerAddress)
        public
        pure
        returns (uint256[5] memory)
    {
        if (fromReferrerAddress != address(0) && toReferrerAddress != address(0)) {
            uint256 fivePercent = fee / 20;
            uint256 eightyPercent = fee - (fivePercent * 4);
            return [fivePercent, fivePercent, fivePercent, fivePercent, eightyPercent];
        } else if (fromReferrerAddress != address(0)) {
            uint256 fivePercent = fee / 20;
            uint256 eightyFivePercent = fee - (fivePercent * 3);
            return [fivePercent, 0, fivePercent, fivePercent, eightyFivePercent];
        } else if (toReferrerAddress != address(0)) {
            uint256 fivePercent = fee / 20;
            uint256 eightyFivePercent = fee - (fivePercent * 3);
            return [0, fivePercent, fivePercent, fivePercent, eightyFivePercent];
        } else {
            uint256 fivePercent = fee / 20;
            uint256 ninetyPercent = fee - (fivePercent * 2);
            return [0, 0, fivePercent, fivePercent, ninetyPercent];
        }
    }

    function calculateTransactionFee(
        address userAddress,
        uint256 amount
    )
        public
        view
        returns (uint256)
    {
        UsersInstance u = UsersInstance(UsersContractAddress);
        require(u.isActive(userAddress), "Not an active user.");
        uint8[2] memory transactionFeeValues = u.getTransactionFeeValues(userAddress);

        if (u.isSuperUser(userAddress)) {
            return 0;
        } else {
            if (amount < flatFeeValues[0]) {
                return amount.mul(transactionFeeValues[0]).div(transactionFeeValues[1]);
            } else {
                return amount.mul(transactionFeeValues[0]).div(transactionFeeValues[1]).add(flatFeeValues[1]);
            }
        }
    }

    function determineTransactionFree(address userAddress)
        public
        view
        returns (bool)
    {
        UsersInstance c = UsersInstance(UsersContractAddress);
        uint16 remainingFreeTransactions = c.getRemainingFreeTransactions(userAddress);

        if (remainingFreeTransactions > 0) {
            return true;
        } else {
            return false;
        }
    }

    function determineWinner(uint256 salt)
        public
        view
        returns (address)
    {
        UsersInstance c = UsersInstance(UsersContractAddress);
        uint256 usersCount = c.usersCount();
        bytes32 lastHash = blockhash(block.number - 1);
        uint256 winnerIndex = uint256(lastHash).add(salt).mod(usersCount);

        return c.getUserAddress(winnerIndex);
    }
}
